import React from "react";
import EditIcon from "../assets/location/EditIcon";
import AppBarTop from "../components/AppBarTop";
import { PADDING } from "../constants/Padding";
import { THEME } from "../constants/Theme";
import { useNavigate } from "react-router-dom";


function Checkout() {
  const [mainLoc, setMainLoc] = React.useState({1:true});
  const navigate = useNavigate()

  const handleBtn = btnId => e => {
    e.preventDefault();
    setMainLoc(false)
    setMainLoc(state => ({
      ...state,
      [btnId]: !setMainLoc[true]
    }));
    console.log(mainLoc)
  };

  return (
    <Box
      sx={{
        width: "100%",
        display: "flex",
        flexDirection: "column",
        justifyContent: "flex-start",
        alignItems: "center",
      }}
    >
      <AppBarTop text={"Keranjang"} line />
      {/* 1 */}
      <Box>
        <Box sx={{display: 'flex'}}>
            <Box sx={{borderRadius: '50%', width: '24px', height: '24px', background: '#F5F5F5'}}/>
            <Typography sx={{fontSize: '12px', fontWeight: 600}}>Pilih semua produk</Typography>
        </Box>
        <Typography>Hapus</Typography>
      </Box>

    </Box>
  );
}

export default Checkout;
